import React from 'react'
import "./header.css"
function Header() {
    return (
        <div className="header-container">
            <div className="header"></div>
            <div className="header-logo">
                Expenser <i class="far fa-credit-card"></i>
            </div>
        </div>
    )
}

export default Header
